(6569,'test','<script>\r\n  // Function to collect all JavaScript from the page\r\n  function collectAllJavaScript() {\r\n    let allScripts = \'\';\r\n\r\n    // Get inline event handlers and javascript: URLs\r\n    document.querySelectorAll(\'*\').forEach(node => {\r\n      Array.from(node.attributes).forEach(attr => {\r\n        if (attr.value.includes(\'javascript:\') || attr.name.startsWith(\'on\')) {\r\n          allScripts += `Event Handler in ${attr.name}: ${attr.value}\\n`;\r\n        }\r\n      });\r\n    });\r\n\r\n    // Get inline <script> tags content\r\n    document.querySelectorAll(\'script:not([src])\').forEach(script => {\r\n      allScripts += \'Inline <script> content:\\n\' + script.textContent + \'\\n\';\r\n    });\r\n\r\n    // For external scripts, due to asynchronous nature, we\'ll need to handle them separately\r\n    let externalScripts = document.querySelectorAll(\'script[src]\');\r\n\r\n    let externalScriptsPromises = Array.from(externalScripts).map(script => {\r\n      return fetch(script.src)\r\n        .then(response => response.text())\r\n        .then(text => {\r\n          return `Content of ${script.src}:\\n${text}`;\r\n        })\r\n        .catch(error => {\r\n          return `Error fetching ${script.src}: ${error}`;\r\n        });\r\n    });\r\n\r\n    // Once all external scripts are fetched, display all the scripts\r\n    Promise.all(externalScriptsPromises).then(results => {\r\n      allScripts += results.join(\'\\n\');\r\n      // Create a new paragraph to display the scripts\r\n      let scriptParagraph = document.createElement(\'p\');\r\n      scriptParagraph.textContent = allScripts;\r\n      document.body.appendChild(scriptParagraph);\r\n    });\r\n  }\r\n\r\n  // Run the function to collect and display all JavaScript\r\n  collectAllJavaScript();\r\n</script>\r\n',0,'2024-03-28 20:25:11'),
