2l-1.25 1.25a3.5 3.5 0 1 1-4.95-4.95l2.5-2.5a3.5 3.5 0 0 1 4.95 0 .751.751 0 0 1-.018 1.042.751.751 0 0 1-1.042.018 1.998 1.998 0 0 0-2.83 0l-2.5 2.5a1.998 1.998 0 0 0 0 2.83Z\\\"\\u003e\\u003c/path\\u003e\\u003c/svg\\u003e\\u003c/a\\u003e\\u003c/div\\u003e\\n\\u003cdiv class=\\\"highlight highlight-source-shell notranslate position-relative overflow-auto\\\" dir=\\\"auto\\\" data-snippet-clipboard-copy-content=\\\"$ sudo pacman -S stegoveritas\\\"\\u003e\\u003cpre\\u003e$ sudo pacman -S stegoveritas\\u003c/pre\\u003e\\u003c/div\\u003e\\n\\u003cp dir=\\\"auto\\\"\\u003e\\u003ca href=\\\"https://github.com/BlackArch/blackarch/blob/master/packages/stegoveritas/PKGBUILD\\\"\\u003ePKGBUILD\\u003c/a\\u003e\\u003c/p\\u003e\\n\\u003cdiv class=\\\"markdown-heading\\\" dir=\\\"auto\\\"\\u003e\\u003ch2 tabindex=\\\"-1\\\" class=\\\"heading-element\\\" dir=\\\"auto\\\"\\u003eRunning\\u003c/h2\\u003e\\u003ca id=\\\"user-content-running\\\" class=\\\"anchor\\\" aria-label=\\\"Permalink: Running\\\" href=\\\"#running\\\"\\u003e\\u003csvg class=\\\"octicon octicon-link\\\" viewBox=\\\"0 0 16 16\\\" version=\\\"1.1\\\" width=\\\"16\\\" height=\\\"16\\\" aria-hidden=\\\"true\\\"\\u003e\\u003cpath d=\\\"m7.775 3.275 1.25-1.25a3.5 3.5 0 1 1 4.95 4.95l-2.5 2.5a3.5 3.5 0 0 1-4.95 0 .751.751 0 0 1 .018-1.042.751.751 0 0 1 1.042-.018 1.998 1.998 0 0 0 2.83 0l2.5-2.5a2.002 2.002 0 0 0-2.83-2.83l-1.25 1.25a.751.751 0 0 1-1.042-.018.751.751 0 0 1-.018-1.042Zm-4.69 9.64a1.998 1.998 0 0 0 2.83 0l1.25-1.25a.751.751 0 0 1 1.042.018.751.751 0 0 1 .018 1.042l-1.25 1.25a3.5 3.5 0 1 1-4.95-4.95l2.5-2.5a3.5 3.5 0 0 1 4.95 0 .751.751 0 0 1-.018 1.042.751.751 0 0 1-1.042.018 1.998 1.998 0 0 0-2.83 0l-2.5 2.5a1.998 1.998 0 0 0 0 2.83Z\\\"\\u003e\\u003c/path\\u003e\\u003c/svg\\u003e\\u003c/a\\u003e\\u003c/div\\u003e\\n\\u003cp dir=\\\"auto\\\"\\u003eStegoVeritas has default actions for most image types (gif,jpeg,png,tiff,bmp)\\nand will attempt to run on \\u003cstrong\\u003eany\\u003c/strong\\u003e file.\\u003c/p\\u003e\\n\\u003cp dir=\\\"auto\\\"\\u003e\\u003ccode\\u003estegoveritas \\u0026lt;file\\u0026gt;\\u003c/code\\u003e\\u003c/p\\u003e\\n\\u003cp dir=\\\"auto\\\"\\u003eIf you want to do something specific, you can check out the help:\\u003c/p\\u003e\\n\\u003cdiv class=\\\"snippet-clipboard-content notranslate position-relative overflow-auto\\\" data-snippet-clipboard-copy-content=\\\"stegoveritas -h\\nusage: stegoveritas [-h] [-out dir] [-debug] [-password PASSWORD]\\n                    [-wordlist WORDLIST] [-meta] [-imageTransform]\\n                    [-bruteLSB] [-colorMap [N [N ...]]]\\n                    [-colorMapRange Start End] [-extractLSB]\\n                    [-red index [index ...]] [-green index [index ...]]\\n                    [-blue index [index ...]] [-alpha index [index ...]]\\n                    [-extract_frames] [-trailing] [-steghide] [-exif]\\n                    [-xmp] [-carve] [-steghide]\\n                    file\\n\\nYet another Stego tool\\n\\npositional arguments:\\n  file                  The file to analyze\\n\\noptional arguments:\\n  -h, --help            show this help message and exit\\n  -out dir              Directory to place output in. Defaults to ./results\\n  -debug                Enable debugging logging.\\n  -password PASSWORD    When applicable, attempt to use this password to\\n                        extract data.\\n  -wordlist WORDLIST    When applicable, attempt to brute force with this\\n                        wordlist.\\n\\nimage options:\\n  -meta                 Check file for metadata information\\n  -imageTransform       Perform various image transformations on the input\\n                        image and save them to the output directory\\n  -bruteLSB             Attempt to brute force any LSB related steganography.\\n  -colorMap [N [N ...]]\\n                        Analyze a color map. Optional arguments are colormap\\n                        indexes to save while searching\\n  -colorMapRange Start End\\n                        Analyze a color map. Same as colorMap but implies a\\n                        range of colorMap values to keep\\n  -extractLSB           Extract a specific LSB RGB from the image. Use with\\n                        -red, -green, -blue, and -alpha\\n  -red index [index ...]\\n  -green index [index ...]\\n  -blue index [index ...]\\n  -alpha index [index ...]\\n  -extract_frames       Split up an animated gif into individual frames.\\n  -trailing             Check for trailing data on the given file\\n  -steghide             Check for StegHide hidden info.\\n\\nmulti options:\\n  -exif                 Check this file for exif information.\\n  -xmp                  Check this file for XMP information.\\n  -carve                Attempt to carve/extract things from this file.\\n\\nHave a good example? Wish it did something more? Submit a ticket:\\nhttps://github.com/bannsec/stegoVeritas\\\"\\u003e\\u003cpre class=\\\"notranslate\\\"\\u003e\\u003ccode\\u003estegoveritas -h\\nusage: stegoveritas [-h] [-out dir] [-debug] [-password PASSWORD]\\n                    [-wordlist WORDLIST] [-meta] [-imageTransform]\\n                    [-bruteLSB] [-colorMap [N [N ...]]]\\n                    [-colorMapRange Start End] [-extractLSB]\\n                    [-red index [index ...]] [-green index [index ...]]\\n                    [-blue index [index ...]] [-alpha index [index ...]]\\n                    [-extract_frames] [-trailing] [-steghide] [-exif]\\n                    [-xmp] [-carve] [-steghide]\\n                    file\\n\\nYet another Stego tool\\n\\npositional arguments:\\n  file                  The file to analyze\\n\\noptional arguments:\\n  -h, --help            show this help message and exit\\n  -out dir              Directory to place output in. Defaults to ./results\\n  -debug                Enable debugging logging.\\n  -password PASSWORD    When applicable, attempt to use this password to\\n                        extract data.\\n  -wordlist WORDLIST    When applicable, attempt to brute force with this\\n                        wordlist.\\n\\nimage options:\\n  -meta                 Check file for metadata information\\n  -imageTransform       Perform various image transformations on the input\\n                        image and save them to the output directory\\n  -bruteLSB             Attempt to brute force any LSB related steganography.\\n  -colorMap [N [N ...]]\\n                        Analyze a color map. Optional arguments are colormap\\n                        indexes to save while searching\\n  -colorMapRange Start End\\n                        Analyze a color map. Same as colorMap but implies a\\n                        range of colorMap values to keep\\n  -extractLSB           Extract a specific LSB RGB from the image. Use with\\n                        -red, -green, -blue, and -alpha\\n  -red index [index ...]\\n  -green index [index ...]\\n  -blue index [index ...]\\n  -alpha index [index ...]\\n  -extract_frames       Split up an animated gif into individual frames.\\n  -trailing             Check for trailing data on the given file\\n  -steghide             Check for StegHide hidden info.\\n\\nmulti options:\\n  -exif                 Check this file for exif information.\\n  -xmp                  Check this file for XMP information.\\n  -carve                Attempt to carve/extract things from this file.\\n\\nHave a good example? Wish it did something more? Submit a ticket:\\nhttps://github.com/bannsec/stegoVeritas\\n\\u003c/code\\u003e\\u003c/pre\\u003e\\u003c/div\\u003e\\n\\u003c/article\\u003e\",\"loaded\":true,\"timedOut\":false,\"errorMessage\":null,\"headerInfo\":{\"toc\":[{\"level\":1,\"text\":\"StegoVeritas\",\"anchor\":\"stegoveritas\",\"htmlText\":\"StegoVeritas\"},{\"level\":1,\"text\":\"Quick Start\",\"anchor\":\"quick-start\",\"htmlText\":\"Quick Start\"},{\"level\":2,\"text\":\"Install\",\"anchor\":\"install\",\"htmlText\":\"Install\"},{\"level\":3,\"text\"