\" dir=\"auto\" data-snippet-clipboard-copy-content=\"$ pip3 install stegoveritas\n$ stegoveritas_install_deps\"><pre>$ pip3 install stegoveritas\n$ stegoveritas_install_deps</pre></div>\n<p dir=\"auto\"><code>stegoveritas_install_deps</code> currently supports: ubuntu, debian, kali, parrotOS, fedora, archlinux and MacOS.</p>\n<div class=\"markdown-heading\" dir=\"auto\"><h3 tabindex=\"-1\" class=\"heading-element\" dir=\"auto\">Option 2 -- docker</h3><a id=\"user-content-option-2----docker\" class=\"anchor\" aria-label=\"Permalink: Option 2 -- docker\" href=\"#option-2----docker\"><svg class=\"octicon octicon-link\" viewBox=\"0 0 16 16\" version=\"1.1\" width=\"16\" height=\"16\" aria-hidden=\"true\"><path d=\"m7.775 3.275 1.25-1.25a3.5 3.5 0 1 1 4.95 4.95l-2.5 2.5a3.5 3.5 0 0 1-4.95 0 .751.751 0 0 1 .018-1.042.751.751 0 0 1 1.042-.018 1.998 1.998 0 0 0 2.83 0l2.5-2.5a2.002 2.002 0 0 0-2.83-2.83l-1.25 1.25a.751.751 0 0 1-1.042-.018.751.751 0 0 1-.018-1.042Zm-4.69 9.64a1.998 1.998 0 0 0 2.83 0l1.25-1.25a.751.751 0 0 1 1.042.018.751.751 0 0 1 .018 1.042l-1.25 1.25a3.5 3.5 0 1 1-4.95-4.95l2.5-2.5a3.5 3.5 0 0 1 4.95 0 .751.751 0 0 1-.018 1.042.751.751 0 0 1-1.042.018 1.998 1.998 0 0 0-2.83 0l-2.5 2.5a1.998 1.998 0 0 0 0 2.83Z\"></path></svg></a></div>\n<div class=\"highlight highlight-source-shell notranslate position-relative overflow-auto\" dir=\"auto\" data-snippet-clipboard-copy-content=\"$ sudo docker run -it --rm bannsec/stegoveritas\"><pre>$ sudo docker run -it --rm bannsec/stegoveritas</pre></div>\n<div class=\"markdown-heading\" dir=\"auto\"><h3 tabindex=\"-1\" class=\"heading-element\" dir=\"auto\">Option 3 -- <a href=\"https://blackarch.org/\" rel=\"nofollow\">BlackArch</a></h3><a id=\"user-content-option-3----blackarch\" class=\"anchor\" aria-label=\"Permalink: Option 3 -- BlackArch\" href=\"#option-3----blackarch\"><svg class=\"octicon octicon-link\" viewBox=\"0 0 16 16\" version=\"1.1\" width=\"16\" height=\"16\" aria-hidden=\"true\"><path d=\"m7.775 3.275 1.25-1.25a3.5 3.5 0 1 1 4.95 4.95l-2.5 2.5a3.5 3.5 0 0 1-4.95 0 .751.751 0 0 1 .018-1.042.751.751 0 0 1 1.042-.018 1.998 1.998 0 0 0 2.83 0l2.5-2.5a2.002 2.002 0 0 0-2.83-2.83l-1.25 1.25a.751.751 0 0 1-1.042-.018.751.751 0 0 1-.018-1.042Zm-4.69 9.64a1.998 1.998 0 0 0 2.83 0l1.25-1.25a.751.751 0 0 1 1.042.018.751.751 0 0 1 .018 1.042l-1.25 1.25a3.5 3.5 0 1 1-4.95-4.95l2.5-2.5a3.5 3.5 0 0 1 4.95 0 .751.751 0 0 1-.018 1.042.751.751 0 0 1-1.042.018 1.998 1.998 0 0 0-2.83 0l-2.5 2.5a1.998 1.998 0 0 0 0 2.83Z\"></path></svg></a></div>\n<div class=\"highlight highlight-source-shell notranslate position-relative overflow-auto\" dir=\"auto\" data-snippet-clipboard-copy-content=\"$ sudo pacman -S stegoveritas\"><pre>$ sudo pacman -S stegoveritas</pre></div>\n<p dir=\"auto\"><a href=\"https://github.com/BlackArch/blackarch/blob/master/packages/stegoveritas/PKGBUILD\">PKGBUILD</a></p>\n<div class=\"markdown-heading\" dir=\"auto\"><h2 tabindex=\"-1\" class=\"heading-element\" dir=\"auto\">Running</h2><a id=\"user-content-running\" class=\"anchor\" aria-label=\"Permalink: Running\" href=\"#running\"><svg class=\"octicon octicon-link\" viewBox=\"0 0 16 16\" version=\"1.1\" width=\"16\" height=\"16\" aria-hidden=\"true\"><path d=\"m7.775 3.275 1.25-1.25a3.5 3.5 0 1 1 4.95 4.95l-2.5 2.5a3.5 3.5 0 0 1-4.95 0 .751.751 0 0 1 .018-1.042.751.751 0 0 1 1.042-.018 1.998 1.998 0 0 0 2.83 0l2.5-2.5a2.002 2.002 0 0 0-2.83-2.83l-1.25 1.25a.751.751 0 0 1-1.042-.018.751.751 0 0 1-.018-1.042Zm-4.69 9.64a1.998 1.998 0 0 0 2.83 0l1.25-1.25a.751.751 0 0 1 1.042.018.751.751 0 0 1 .018 1.042l-1.25 1.25a3.5 3.5 0 1 1-4.95-4.95l2.5-2.5a3.5 3.5 0 0 1 4.95 0 .751.751 0 0 1-.018 1.042.751.751 0 0 1-1.042.018 1.998 1.998 0 0 0-2.83 0l-2.5 2.5a1.998 1.998 0 0 0 0 2.83Z\"></path></svg></a></div>\n<p dir=\"auto\">StegoVeritas has default actions for most image types (gif,jpeg,png,tiff,bmp)\nand will attempt to run on <strong>any</strong> file.</p>\n<p dir=\"auto\"><code>stegoveritas &lt;file&gt;</code></p>\n<p dir=\"auto\">If you want to do something specific, you can check out the help:</p>\n<div class=\"snippet-clipboard-content notranslate position-relative overflow-auto\" data-snippet-clipboard-copy-content=\"stegoveritas -h\nusage: stegoveritas [-h] [-out dir] [-debug] [-password PASSWORD]\n                    [-wordlist WORDLIST] [-meta] [-imageTransform]\n                    [-bruteLSB] [-colorMap [N [N ...]]]\n                    [-colorMapRange Start End] [-extractLSB]\n                    [-red index [index ...]] [-green index [index ...]]\n                    [-blue index [index ...]] [-alpha index [index ...]]\n                    [-extract_frames] [-trailing] [-steghide] [-exif]\n                    [-xmp] [-carve] [-steghide]\n                    file\n\nYet another Stego tool\n\npositional arguments:\n  file                  The file to analyze\n\noptional arguments:\n  -h, --help            show this help message and exit\n  -out dir              Directory to place output in. Defaults to ./results\n  -debug                Enable debugging logging.\n  -password PASSWORD    When applicable, attempt to use this password to\n                        extract data.\n  -wordlist WORDLIST    When applicable, attempt to brute force with this\n                        wordlist.\n\nimage options:\n  -meta                 Check file for metadata information\n  -imageTransform       Perform various image transformations on the input\n                        image and save them to the output directory\n  -bruteLSB             Attempt to brute force any LSB related steganography.\n  -colorMap [N [N ...]]\n                        Analyze a color map. Optional arguments are colormap\n                        indexes to save while searching\n  -colorMapRange Start End\n                        Analyze a color map. Same as colorMap but implies a\n                        range of colorMap values to keep\n  -extractLSB           Extract a specific LSB RGB from the image. Use with\n                        -red, -green, -blue, and -alpha\n  -red index [index ...]\n  -green index [index ...]\n  -blue index [index ...]\n  -alpha index [index ...]\n  -extract_frames       Split up an animated gif into individual frames.\n  -trailing             Check for trailing data on the given file\n  -steghide             Check for StegHide hidden info.\n\nmulti options:\n  -exif                 Check this file for exif information.\n  -xmp                  Check this file for XMP information.\n  -carve                Attempt to carve/extract things from this file.\n\nHave a good example? Wish it did something more? Submit a ticket:\nhttps://github.com/bannsec/stegoVeritas\"><pre class=\"notranslate\"><code>stegoveritas -h\nusage: stegoveritas [-h] [-out dir] [-debug] [-password PASSWORD]\n                    [-wordlist WORDLIST] [-meta] [-imageTransform]\n                    [-bruteLSB] [-colorMap [N [N ...]]]\n                    [-colorMapRange Start End] [-extractLSB]\n                    [-red index [index ...]] [-green index [index ...]]\n                    [-blue index [index ...]] [-alpha index [index ...]]\n                    [-extract_frames] [-trailing] [-steghide] [-exif]\n                    [-xmp] [-carve] [-steghide]\n                    file\n\nYet another Stego tool\n\npositional arguments:\n  file                  The file to analyze\n\noptional arguments:\n  -h, --help            show this help message and exit\n  -out dir              Directory to place output in. Defaults to ./results\n  -debug                Enable debugging logging.\n  -password PASSWORD    When applicable, attempt to use this password to\n                        extract data.\n  -wordlist WORDLIST    When applicable, attempt to brute force with this\n                        wordlist.\n\nimage options:\n  -meta                 Check file for metadata information\n  -imageTransform       Perform various image transformations on the input\n                        image and save them to the output directory\n  -bruteLSB             Attempt to brute force any LSB related steganography.\n  -colorMap [N [N ...]]\n                        Analyze a color map. Optional arguments are colormap\n                        indexes to save while searching\n  -colorMapRange Start End\n                        Analyze a color map. Same as colorMap but implies a\n                        range of colorMap values to keep\n  -extractLSB           Extract a specific LSB RGB from the image. Use with\n                        -red, -green, -blue, and -alpha\n  -red index [index ...]\n  -green index [index ...]\n  -blue index [index ...]\n  -alpha index [index ...]\n  -extract_frames       Split up an animated gif into individual frames.\n  -trailing             Check for trailing data on the given file\n  -steghide             Check for StegHide hidden info.\n\nmulti options:\n  -exif                 Check this file for exif information.\n  -xmp                  Check this file for XMP information.\n  -carve                Attempt to carve/extract things from this file.\n\nHave a good example? Wish it did something more? Submit a ticket:\nhttps://github.com/bannsec/stegoVeritas\n</code></pre></div>\n</article></div></div></div></div></div> <!-- --> <!-- --> <script type=\"application/json\" id=\"__PRIMER_DATA__\">{\"resolvedServerColorMode\":\"day\"}</script></div>\n</react-partial>\n\n        <input type=\"hidden\" data-csrf=\"true\" value=\"oJlQsXB3ULg5melO13Kf9yG7ziCh/pVmidXoDRYow3MdXxzaBHcJJjzbt2MCwwuq89h7wCtEXj9F+FW5pzNlTA==\" />\n</div>\n  <div data-view-component=\"true\" class=\"Layout-sidebar\">      \n\n      <div class=\"BorderGrid about-margin\" data-pjax>\n        <div class=\"BorderGrid-row\">\n          <div class=\"BorderGrid-cell\">\n            <div class=\"hide-sm hide-md\">\n  <h2 class=\"mb-3 h4\">About</h2>\n\n      <p class=\"f4 my-3\">\n        Yet another Stego Tool\n      </p>\n\n    <h3 class=\"sr-only\">Topics</h3>\n    <div